import React from 'react';
import web from "../src/images/aboutus.jpg";
import Common from './Common';

const AboutUs = () => {

    return(
        <>
        <Common name="Welcome to About page." imgsrc={web} visit="/contact" btname="Contact Us"/>
        </>

    )
}

export default AboutUs;
